import React from "react";
import styled from "styled-components";
import {StyledBlueTriangle} from "../components/Triangles.js";
import blueTriangle from "../misc/images/tr_2.png";
// import {HeroImage} from "../components/HeroImage.js"
import {HeroImg} from "../components/HeroImage";
const HeroPageWrapper = styled.section`
  width: 100%;
  height: 100%;
  background-color: #242526;
`;

const TriangleWrapper = styled.div`
height: 100vh;
width: 100vw;
`;

function HeroPage() {
    return(
        <HeroPageWrapper>
            <HeroImg></HeroImg>
            <TriangleWrapper>
                <StyledBlueTriangle as="img" src={blueTriangle} alt="blue" />
            </TriangleWrapper>
        </HeroPageWrapper>

    )
}

export {HeroPage};
